import{_ as a,c as e,o as r,a4 as t}from"./chunks/framework.D7GeWW9s.js";const f=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"zh_cn/faq/faq.md","filePath":"zh_cn/faq/faq.md","lastUpdated":1719132640000}'),o={name:"zh_cn/faq/faq.md"},s=t('<p>以下是一些常见问题</p><h2 id="导入导出是备份功能吗" tabindex="-1">导入导出是备份功能吗 <a class="header-anchor" href="#导入导出是备份功能吗" aria-label="Permalink to &quot;导入导出是备份功能吗&quot;">​</a></h2><p>导入导出不是备份功能，它只能导出图标卡片的配置文件，不能导出图标文件，目前项目没有自带的备份功能，后期会考虑加入</p><h2 id="docker-版本升级后数据丢失了" tabindex="-1">docker 版本升级后数据丢失了 <a class="header-anchor" href="#docker-版本升级后数据丢失了" aria-label="Permalink to &quot;docker 版本升级后数据丢失了&quot;">​</a></h2><ol><li>在v1.4.0版本做了docker精简了挂载目录，请严格按照教程升级。</li><li>挂载目录不正确，请检查路径并区分大小写</li></ol><h2 id="项目的-docker-卡片显示异常" tabindex="-1">项目的 docker 卡片显示异常 <a class="header-anchor" href="#项目的-docker-卡片显示异常" aria-label="Permalink to &quot;项目的 docker 卡片显示异常&quot;">​</a></h2><p>请使用docker管理工具检查是否删除了该容器，或者升级了容器，如果升级了该容器，卡片绑定的旧容器ID将不可用。可以编辑卡片重新选择容器</p><h2 id="linux-二进制版本无法运行" tabindex="-1">Linux 二进制版本无法运行 <a class="header-anchor" href="#linux-二进制版本无法运行" aria-label="Permalink to &quot;Linux 二进制版本无法运行&quot;">​</a></h2><p>在 github 的 <a href="https://github.com/hslr-s/sun-panel/releases" target="_blank" rel="noreferrer">releases</a> 下载的二进制Linux版本无法运行，可以尝试下载带有 <code>musl</code> 标记的版本运行</p><h2 id="内外网环境-模式-是什么-能否只显示对应的图标卡片" tabindex="-1">内外网环境（模式）是什么；能否只显示对应的图标卡片 <a class="header-anchor" href="#内外网环境-模式-是什么-能否只显示对应的图标卡片" aria-label="Permalink to &quot;内外网环境（模式）是什么；能否只显示对应的图标卡片&quot;">​</a></h2><p>作者所谓的内网环境和外网环境可以理解为，我们当前所处于的真实环境。</p><p>比如说项目（Sun-Panel）部署机在家，我们目前也在家访问项目，那么我们可以将家中电脑的 Sun-Panel 环境设置为内网环境。而将在家以外常用电脑的 Sun-Panel 环境设置为外网环境。不需要频繁切换，也不怕混淆。</p><p>基于以上理解考虑到处于内网环境也需要访问外网地址或者相反，所以没有对图标的内外网环境区分显示</p><h2 id="自定义页脚不能执行js-script标签-代码" tabindex="-1">自定义页脚不能执行js（script标签）代码 <a class="header-anchor" href="#自定义页脚不能执行js-script标签-代码" aria-label="Permalink to &quot;自定义页脚不能执行js（script标签）代码&quot;">​</a></h2><p>由于框架安全限制，暂时不支持，后期将找办法支持。暂时可以通过 <a href="./../advanced/custom_js_css.html">自定义js</a> 来实现此功能</p>',15),n=[s];function c(l,i,d,h,p,_){return r(),e("div",null,n)}const k=a(o,[["render",c]]);export{f as __pageData,k as default};
